class Solution:
    def maxOperations(self, s: str) -> int:
        moves : int = 0
        curr : int = 0
        temp : List[str] = s.split("0")
        if s[-1] == "1": temp.pop()

        for c in temp:
            if c: # c has 1s in
                curr += c.count("1")
                moves += curr

        return moves
